import React from "react";
import { useAuthStore } from "../stores/authStore";

const AuthDebug = () => {
  const { isAuthenticated, userType, user, ong } = useAuthStore();

  return (
    <div
      style={{
        position: "fixed",
        top: "10px",
        right: "10px",
        backgroundColor: "black",
        color: "white",
        padding: "10px",
        fontSize: "12px",
        zIndex: 10000,
        border: "2px solid red",
      }}
    >
      <div>Auth: {isAuthenticated ? "✅" : "❌"}</div>
      <div>Type: {userType || "null"}</div>
      <div>User: {user ? user.name || "sem nome" : "null"}</div>
      <div>ONG: {ong ? ong.name || "sem nome" : "null"}</div>
      <div>Time: {new Date().toLocaleTimeString()}</div>
    </div>
  );
};

export default AuthDebug;
